import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Background from './components/background.js'
import Header from './components/header.js'

class App extends Component {
  render() {
    return (


      <div className="App">

      <Background />
      <Header />

      </div>
    );
  }
}

export default App;
